  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:11.983502\",\n\t\"name\": \"neal-smith-national-wildlife-refuge-iowa-contaminants-investigation-final-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This document serves as the final report
  for the Neal Smith National Wildlife Refuge (Refuge) (formerly known as the Walnut
  Creek National Wildlife Refuge) contaminants investigation (DEC number 9530006b
  and FFS number 3N19). Staff from the U.S. Fish and Wildlife Service (USFWS) obtained
  funding in 1995 from the on-refuge contaminants investigation program to help develop
  one of Iowa's first U.S. Environmental Protection Agency (USEPA) non-point source
  pollution studies (Clean Water Act Section 319 grant). The study area for the project
  was the Walnut Creek Watershed which contains the Refuge property. The investigation
  was conducted and coordinated by the Iowa Department of Natural Resources. The timing
  of the 319 study was beneficial to USFWS because restoration specialists working
  at this newly created national wildlife refuge used the 319 project to prioritize
  contaminant sources and problems, target water quality improvement projects and
  develop GIS databases for future restoration planning. A Service CAP study was also
  completed to assist in this effort. The 319 study investigation team characterized
  water quality and non-point source pollution conditions in the Walnut Creek watershed
  and the paired agricultural watershed. There were large scale conversion of cropfields
  to grassland habitats in the Refuge that affected contaminant transport and fate.
  The attached report includes information on the national 319 program, other 319
  projects across the country and results to date for the Walnut Creek Watershed project.\",\n\t\"license_title\":
